  const {cars} = useSelector((state) => state);

  const d = useDispatch();



  return (
    <Container>
      <div className="container-fluid">
        <div className="row">
          {cars.map((car, index) => (
            <Car key={index} car={car} />
          ))}
        </div>
      </div>
    </Container>
  );
}

export default List;
